import React from 'react';

export const themes = {
  dark: {
    background: '#152642',
    codeBackground: '#eff0f1',
    codeText: '#393318',
    primary: '#081B33',
    secondary: '#3a3d42',
    text: '#fff'
  },
  light: {
    background: '#fff',
    codeBackground: '#081B33',
    codeText: 'rgb(255, 255, 255)',
    primary: '#26a1d4',
    secondary: '#e6e7eb',
    text: '#333'
  }
};

export const ThemeContext = React.createContext(
  themes.dark
);
